import React, { useState, useEffect } from "react";

import { Route, Redirect, useHistory, useLocation } from "react-router-dom";

function PrivateRoute(props, { children, ...rest }) {
  return (
    <Route
      {...rest}
      render={({ location }) =>
        isAuthenticated ? (
          children
        ) : (
          <Redirect
            to={{
              pathname: "/admin",
              state: { from: location }
            }}
          />
        )
      }
    />
  );
}

export default PrivateRoute;
